import React from 'react'

export function ExpiringDocuments() {
  const documents = [
    {
      id: 1,
      name: "RCA Vehicul B-123-ABC",
      expiryDate: "15.01.2025",
      status: "warning",
    },
    {
      id: 2,
      name: "ITP Vehicul B-456-DEF",
      expiryDate: "20.02.2025",
      status: "danger",
    },
    // ... mai multe documente
  ]

  return (
    <div className="space-y-4">
      {documents.map((doc) => (
        <div
          key={doc.id}
          className="flex items-center justify-between p-4 rounded-lg bg-background"
        >
          <div className="space-y-1">
            <p className="text-sm font-medium leading-none">{doc.name}</p>
            <p className={`text-sm ${
              doc.status === 'danger' ? 'text-red-500' : 'text-yellow-500'
            }`}>
              ExpirÄƒ: {doc.expiryDate}
            </p>
          </div>
        </div>
      ))}
    </div>
  )
}
